"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Insomnia (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/insomnia-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H17011166\">",
"      <span class=\"h1\">",
"       What is insomnia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Insomnia is a problem with sleep. People with insomnia have trouble falling or staying asleep, or they do not feel rested when they wake up. Insomnia is not about the number of hours of sleep a person gets. Everyone needs a different amount of sleep.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17011181\">",
"      <span class=\"h1\">",
"       What are the symptoms of insomnia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;People with insomnia often:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Have trouble falling or staying asleep",
"       </li>",
"       <li>",
"        Feel tired or sleepy during the day",
"       </li>",
"       <li>",
"        Forget things or have trouble thinking clearly",
"       </li>",
"       <li>",
"        Get cranky, anxious, irritable, or depressed",
"       </li>",
"       <li>",
"        Have less energy or interest in doing things",
"       </li>",
"       <li>",
"        Make mistakes or get into accidents more often than normal",
"       </li>",
"       <li>",
"        Worry about their lack of sleep",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      These symptoms can be so bad that they affect a person&rsquo;s relationships or work life. Plus, they can happen even in people who seem to be sleeping enough hours.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17011190\">",
"      <span class=\"h1\">",
"       Are there tests I should have?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Probably not. Most people with insomnia need no tests. Your doctor or nurse will probably be able to tell what is wrong just by talking to you. He or she might also ask you to keep a daily log for 1 to 2 weeks, where you keep track of how you sleep each night (",
"      <a class=\"graphic graphic_figure graphicRef87134 \" href=\"UTD.htm?4/53/4955\">",
"       figure 1",
"      </a>",
"      and",
"      <a class=\"graphic graphic_table graphicRef87859 \" href=\"UTD.htm?13/62/14318\">",
"       table 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      In some cases, people do need special sleep tests, such as &ldquo;polysomnography&rdquo; or &ldquo;actigraphy.&rdquo;",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Polysomnography &ndash; Polysomnography is a test that usually lasts all night and that is done in a sleep lab. During the test, monitors are attached to your body to record movement, brain activity, breathing, and other body functions.",
"       </li>",
"       <li>",
"        Actigraphy &ndash; Actigraphy records activity and movement with a monitor or motion detector that is usually worn on the wrist. The test is done at home, over several days and nights. It will record how much you actually sleep and when.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17011140\">",
"      <span class=\"h1\">",
"       What can I do to improve my insomnia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You can follow good &ldquo;sleep hygiene.&rdquo; That means that you:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Sleep only long enough to feel rested and then get out of bed",
"       </li>",
"       <li>",
"        Go to bed and get up at the same time every day",
"       </li>",
"       <li>",
"        Do not try to force yourself to sleep. If you can't sleep, get out of bed and try again later.",
"       </li>",
"       <li>",
"        Have coffee, tea, and other foods that have caffeine only in the morning",
"       </li>",
"       <li>",
"        Avoid alcohol in the late afternoon, evening, and bedtime",
"       </li>",
"       <li>",
"        Avoid smoking, especially in the evening",
"       </li>",
"       <li>",
"        Keep your bedroom dark, cool, quiet, and free of reminders of work or other things that cause you stress",
"       </li>",
"       <li>",
"        Solve problems you have before you go to bed",
"       </li>",
"       <li>",
"        Exercise several days a week, but not right before bed",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Other things that can improve sleep include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Relaxation therapy, in which you focus on relaxing all the muscles in your body 1 by 1",
"       </li>",
"       <li>",
"        Working with a counselor or psychologist to deal with the problems that might be causing poor sleep",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17011217\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If you have insomnia, and it is troubling you, see your doctor or nurse. He or she might have suggestions on how to fix the problem.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17011147\">",
"      <span class=\"h1\">",
"       Are there medicines to help me sleep?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes, there are medicines to help with sleep. But you should try them only after you try the techniques described above. You also should not use sleep medicines every night for long periods of time. Otherwise, you can become dependent on them for sleep.",
"     </p>",
"     <p>",
"      Insomnia is sometimes caused by mental health problems, such as depression or anxiety. If that's the case for you, you might benefit from an antidepressant rather than a sleep aid. Antidepressants often improve sleep and can help with other worries, too.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17011154\">",
"      <span class=\"h1\">",
"       Can I use alcohol to help me sleep?",
"      </span>",
"      &nbsp;&mdash;&nbsp;No, do not use alcohol as a sleep aid. Even though alcohol makes you sleepy at first, it disrupts sleep later in the night.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17011264\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
