"      <i>",
"       N Engl J Med",
"      </i>",
"      , 2010, 363(21):1991-2003.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"UTD.htm?21/58/22437/abstract-text/21083385/pubmed\" id=\"21083385\" target=\"_blank\">",
