" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Indications for special studies during perinatal autopsy",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Hydrops fetalis and/or placentitis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Viral cultures (fetus/placenta), request maternal screen",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Kleihaur-Betke",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Fetal blood smear if possible",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Fetal hematocrit if possible",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Freeze liver (at 4 degrees Celcius) for possible metabolic studies",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Consider post-mortem blood spot for standard neonatal screening",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Obtain tissue for karyotype",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Skeletal dysplasias (short limbs, any boney anomaly)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Good radiographs",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Save fresh boney and skeletal muscle for biochemistry",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Obtain tissue for karyotype",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       <p>",
"        Consider consultation with the Skeletal Registry at Cedars Sinai Medical Center:",
"       </p>",
"       <p>",
"        (1-800-CEDARS-1 (233-2771)",
"       </p>",
"       <p>",
"        file://www.cedars-sinai.edu/9934.html",
"       </p>",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
