var title_f21_58_22445="BRCA testing NCCN criteria";
var content_f21_58_22445=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F56222&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F56222&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    National Comprehensive Cancer Network criteria for consideration of BRCA1/2 genetic testing",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        A. Individual from a family with a known deleterious BRCA1/BRCA2 mutation*&bull;&Delta;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        B. Personal history of breast cancer&loz; plus one or more of the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        <ul>",
"         <li>",
"          Diagnosed age &le;45 years",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        <ul>",
"         <li>",
"          Diagnosed age &le;50 years with &ge;1 first, second, or third-degree blood relative with breast cancer &le;50 years and/or &ge;1 first, second, or third-degree blood relative with epithelial ovarian/fallopian tube/primary peritoneal cancer at any age",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        <ul>",
"         <li>",
"          Two breast primaries&sect; when first breast cancer diagnosis occurred &le;50 years",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        <ul>",
"         <li>",
"          Diagnosed &le;60 years with a triple negative breast cancer",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        <ul>",
"         <li>",
"          Diagnosed &le;50 years with a limited family history&Delta;",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        <ul>",
"         <li>",
"          Diagnosed at any age with &ge;2 first, second, or third-degree blood relatives with breast and/or epithelial ovarian/fallopian tube/primary peritoneal cancer at any age",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        <ul>",
"         <li>",
"          Diagnosed at any age with &ge;2 first, second, or third-degree blood relatives with&nbsp;pancreatic cancer at any age",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        <ul>",
"         <li>",
"          First, second, or third-degree male blood relative with breast cancer",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        <ul>",
"         <li>",
"          For an individual of ethnicity associated with higher mutation frequency (eg, Ashkenazi Jewish), no additional family history may be required&yen;",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        C. Personal history of epithelial ovarian/fallopian tube/primary peritoneal cancer",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        D. Personal history of male breast cancer",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        E. Personal history of pancreatic cancer at any age with &ge;2 first, second, or third-degree blood relatives with breast and/or ovarian cancer and/or pancreatic cancer at any age",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        F. Family history only������:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        <ul>",
"         <li>",
"          First or second-degree blood relative meeting any of the above criteria",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        <ul>",
"         <li>",
"          Third-degree blood relative with breast cancer&loz; and/or ovarian/fallopian tube/primary peritoneal cancer with &ge;2 first, second, or third-degree blood relatives with breast cancer (at least one breast cancer &le;50 years) and/or ovarian/fallopian tube/primary peritoneal cancer",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * One or more of these criteria is suggestive of hereditary breast/ovarian cancer syndrome that warrants further personalized risk assessment, genetic counseling, and management. The maternal and paternal sides should be considered independently. Other malignancies reported in some hereditary breast/ovarian cancer syndrome families include prostate and melanoma.",
"     <br>",
"      &bull; Patients who have received an allogeneic bone marrow transplant should not have molecular genetic testing via blood or buccal samples due to unreliable test results from contamination by donor DNA. If available, DNA should be extracted from a fibroblast culture. If the source of DNA is not possible, buccal samples can be considered, subject to the risk of donor DNA contamination.",
"      <br>",
"       &Delta; Individuals with a limited family history, such as fewer than two first- or second-degree female relatives or female relatives surviving beyond 45 years in either lineage, may have an underestimated probability of a familial mutation.",
"       <br>",
"        &loz; For the purposes of these guidelines, invasive and ductal carcinoma in situ breast cancers should be included.",
"        <br>",
"         &sect; Two breast primaries include bilateral (contralateral) disease or two or more clearly separate ipsilateral primary tumors either synchronously or asynchronously.",
"         <br>",
"          &yen; Testing for Ashkenazi Jewish founder-specific mutation(s) should be performed first. Full sequencing may be considered if ancestry also includes non-Ashkenazi Jewish relatives or other hereditary breast/ovarian cancer criteria are met. Founder mutations exist in other populations.",
"          <br>",
"           &Dagger; Testing of unaffected family members should only be considered when no affected family member is available, and then the unaffected family member with the highest probability of mutation should be tested. Significant limitations of interpreting test results should be discussed.",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     National Comprehensive Cancer Network, v1.2012 (",
"     <a href=\"file://www.nccn.org\" target=\"_blank\">",
"      www.nccn.org",
"     </a>",
"     ).",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
